import React, { Component } from 'react';
import logo from './logo.jpg';
import './react_css.css';
import Welcome from './components/welcome';

class App extends Component {
  render() {
    return (
      <div>
        <header>
          <img src={logo} className="logo" />
        </header>
        <Welcome/>
      </div>
    );
  }
}

export default App;
